import { useState } from "react";
import Auxillary from "./Auxillary";
function Card(props){

    const [header,setHeader] = useState(props.header);

    return <div class="Card">
        <h3>{header}</h3>
        <Auxillary/>
        <h4>Front-End</h4>
    </div>;
}


export default Card;
